webpackJsonp([81133599756275],{1154:function(A,a){A.exports={data:{site:{siteMetadata:{title:"Justin Ball",author:"Justin Ball"}},markdownRemark:{id:"/Users/jbasdf/projects/justinball/src/posts/2009-04-18-first-ride-up-black-smith-fork-canyon-this-season/index.md absPath of file >>> MarkdownRemark",html:'<p>The weather in Cache Valley finally improved and so I thought I better take advantage of the situation and ride. After <a href="http://www.justinball.com/2008/09/08/why-cyclists-shave-their-legs-the-most-disgusting-post-i-will-ever-make/">last years run in with a rattle snake</a> I told myself and my wife that I wouldn\'t ride up there alone. My first ride, I couldn\'t find anyone to go with. How smart am I?</p>\n<p>I did take a camera and stopped to take a picture of where I got to hang out on the asphalt after trashing my knee last year:</p>\n\n  <a class="gatsby-resp-image-link" href="/static/img_9765-9feb1c5285991656b7a3d89babd6eb13-45873.jpg" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 133.33333333333331%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="Black Smith Fork Canyon" title="" src="/static/img_9765-9feb1c5285991656b7a3d89babd6eb13-b80fa.jpg" srcset="/static/img_9765-9feb1c5285991656b7a3d89babd6eb13-cf410.jpg 163w,\n/static/img_9765-9feb1c5285991656b7a3d89babd6eb13-62f2a.jpg 325w,\n/static/img_9765-9feb1c5285991656b7a3d89babd6eb13-b80fa.jpg 650w,\n/static/img_9765-9feb1c5285991656b7a3d89babd6eb13-08cb4.jpg 975w,\n/static/img_9765-9feb1c5285991656b7a3d89babd6eb13-f2bf9.jpg 1300w,\n/static/img_9765-9feb1c5285991656b7a3d89babd6eb13-45873.jpg 1944w" sizes="(max-width: 650px) 100vw, 650px">\n    </span>\n  </span>\n  \n  </a>\n    \n<p>Most inquiring minds and dedicated fans who diligently follow me in the sport of cycling will want to know how the ride went. I don\'t want to disappoint so I will lie and say it was great.</p>\n<p>It was fun, but 2 months with your leg in a brace and another 4 months with holidays whose sole meaning is to bring joy to the world via junk food really ruins your body. I made it to the top and by a miracle from heaven I even made it home but I don\'t feel so good right now so I\'m going to go lay down.</p>',frontmatter:{title:"First ride up Black Smith Fork canyon this season",date:"April 18, 2009",imageUrl:null,image:{childImageSharp:{sizes:{src:"/static/img_9765-9feb1c5285991656b7a3d89babd6eb13-381d6.jpg"}}}}}},pathContext:{path:"/first-ride-up-black-smith-fork-canyon-this-season"}}}});
